import React from 'react'
import { Container, Row, Col } from 'react-bootstrap'

const FormLargeContainer = ({children}) => {
    return (
        <Container className='mt-5'>
            <Row className='justify-content-md-center'>
                <Col xs={12} md={8} >
                    {children}
                </Col>
            </Row>
        </Container>
    )
}

export default FormLargeContainer
